class AddCat extends Component{
    state = {};
  render() {
    return (
      <React.Fragment>
          <div>
        <h1>Add New Cat</h1>
        </div>
        <div>
            <label>Name</label>
            <input type="text"/>

        </div>
      </React.Fragment>
    );
  }
}

export default AddCat;
